import React from 'react';
import './App.css';

function App() {
  return (
    <div className="card">
      <div className="card-body">
        <h5 className="card-title">Issue Tracker ASW</h5>
        <h6 className="card-subtitle mb-2 text-muted">https://secure-crag-93015.herokuapp.com/</h6>
      </div>
    </div>
  );
}

export default App;
